import React, { useState, useEffect } from 'react';
import {
    Header, Icon, Form, Image, Message,
    Segment, Grid, Modal, Search, Button, Dimmer, Loader, Divider, List
} from 'semantic-ui-react';

const Registration_First = () => {

    const [state, dispatch] = useReducer(reducer, initialState)


    const onChange = e => {
        dispatch({ type: "registration_first" , field: e.target.name, value: e.target.value })
    }

    return (
            <Grid textAlign='center' verticalAlign='middle'>
                <Grid.Column style={{ maxWidth: 450 }}>
                    <Header as='h2' color='black' textAlign='center' style={{ padding: "10px" }}>
                        Registration
                    </Header>
                    <br />
                    <Divider horizontal>Or</Divider>
                    <Form size='small'>
                        <Segment stacked>
                            <Form.Input fluid icon='user' iconPosition='left' placeholder='E-mail address' />
                            <Form.Input
                                fluid
                                icon='lock'
                                iconPosition='left'
                                placeholder='Password'
                                type='password'
                            />

                            <Button color='teal' fluid size='large'>
                                Login
                        </Button>
                        </Segment>
                    </Form>

                </Grid.Column>
            </Grid>
    )
        
}

export default Registration_First;
